import React from "react";

const Skills = () => {
    const skills = [{
        'Frontend Technologies': [
            "HTML5",
            "CSS",
            "SCSS",
            "Tailwind CSS",
            "React.js",
        ]},
        {
            'Backend Technologies': [
            "Node.js",
            "Express.js",
        ]
        },
        {
            'Programming Languages': [
            "Java",
            "C++",
            "C#",
            "Python",
            "Assembly Language",
        ]
        },
        {
            "Database Management": [
            "SQL",
            "Oracle",
            "MongoDB",
        ]
        },
        {
            "Development Tools": [
            "VS Code",
            "PyCharm",
            "Postman",
            "Visual Studio",
            "8086 Emulator",
        ]
        },
        {
           "Version Control": [
            "Git",
            "GitHub",
        ] 
        },
        {
            "Others": [
            "OOP",
            "DSA",
            "Competitive Programming",
        ]
        },
        
    ];
    console.log(skills[0]);


    return (
        <section id="skills" className="py-16 bg-gray-900">
            <div className="container mx-auto px-4">
                <h2 className="text-3xl font-bold text-blue-500 mb-8">Skills</h2>
                <div className="flex flex-wrap gap-4">
                {
  skills.map((category, index) => {
    // Get the category name (e.g., "Frontend Technologies")
    const categoryName = Object.keys(category)[0];
    // Get the skills array for the category
    const skillsList = category[categoryName];

    return (
      <div key={index} className="mb-8">
        <h3 className="text-2xl font-bold text-blue-500 mb-4">{categoryName}</h3>
        <div className="flex flex-wrap gap-4">
          {skillsList.map((skill, skillIndex) => (
            <div
              key={skillIndex}
              className="px-6 py-3 bg-gray-800 text-white rounded-lg hover:bg-gray-700 transition duration-300"
            >
              {skill}
            </div>
          ))}
        </div>
      </div>
    );
  })
}
                </div>
            </div>
        </section>
    );
};

export default Skills;
